import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import Person from './Persons/Person';

class App extends Component {
  render() {
    return (
      <div className="App">
       <h1>Welcome</h1>
       <Person />
      </div>
    );
  }
}

export default App;
